import './Header.css'
import React from 'react'

function Header () {
    return (
        <nav>
            <div className='header-logo'>
                <a>OUT</a>
            </div>
            <div className='nav-container'> 
                <ul>
                    <li><a>Collection</a></li>
                    <li><a>Echantillons</a></li>
                    <li><a>Salles d'exposition</a></li>
                    <li><a>A propos de nous</a></li>
                </ul>
            </div>
        </nav>
    );
}

export default Header;
